import React from 'react';
import ReactDOM from 'react-dom';
import MenuList from "@material-ui/core/MenuList";
import MenuItem from "@material-ui/core/MenuItem";
import './index.css';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
  <div id="menu-too">

      <img src="" alt = "logo"></img>
      <MenuList className="simple-menu">
        <MenuItem>Pank</MenuItem>
        <MenuItem>Finantsportaal</MenuItem>
        <MenuItem>Investor</MenuItem>
      </MenuList>
      <MenuList className="menu">
        <MenuItem>Ava konto</MenuItem>
        <MenuItem>Sisene</MenuItem>
        <MenuItem>EN</MenuItem>
        <MenuItem>RU</MenuItem>
      </MenuList>
    </div>

    <div>
    <MenuList className="nupud">
        <MenuItem>ID-kaart</MenuItem>
        <MenuItem>Mobiil-ID</MenuItem>
        <MenuItem>Smart-ID</MenuItem>
        <MenuItem>PIN-kalkulaator</MenuItem>
        <MenuItem>Salas√µna</MenuItem>
        <FormData>Kasutajanimi</FormData>
        <button>Sisene</button>
      </MenuList>
    </div>
    <div id="slider">
     {/*3 pildiga slider */}
    </div>

  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
